import React from 'react';
import PropTypes from 'prop-types';
import styles from './Nav.module.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class Nav extends React.Component{
    render(){
        return (
            <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarsExample03"
                        aria-controls="navbarsExample03" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>

                <div className="collapse navbar-collapse" id="navbarsExample03">
                    <ul className="navbar-nav mr-auto">
                        <li className="nav-item active">
                            <a className="nav-link" href="/items">Polévky<span className="sr-only">(current)</span></a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="/item">Hlavní chody</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Dezerty</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Vytvořit nový</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#">Seznam</a>
                        </li>
                    </ul>
                </div>
            </nav>
        );
    }
}

export default Nav;
